import React from "react";

import logo from "../src/Images/logo.png";

import "./App.css";

function App() {
  return (
    <nav id="navbar">
      <ul>
        <li>
          <a href="#">home</a>
        </li>
        <li>
          <a href="#">about</a>
        </li>
        <img src={logo} className="logoImg" alt="logo" />
        <li>
          <a href="#">services</a>
        </li>
        <li>
          <a href="#">contact</a>
        </li>
      </ul>
    </nav>
  );
}

export default App;
